window.bookSummaryJSON = "<p>Sometimes you miss the things that are staring you in the face.</p> <p>I honestly thought things couldn't get any worse. I was wrong.</p> <p>Now I'm forced to defend my enemy to protect what's dearest to me. Forced to trust the very thing I've been fighting against.</p> <p>I can't do this alone, and if I play my cards right I won't have to.</p> <p>Everything has led to this. All the threads are coming together, and the pieces of the puzzle are slotting into place.</p> <p>Question is, where do I really fit in?</p> <p>Contains mature themes.</p>"; 
